import NewGoal from "./NewGoal";
import "./GoalBox.css";
function GoalBox(props){
    return(
        <div className="goal">
            <NewGoal newGoal={newGoalHandler} onAddNewGoal={props.addNewGoal}/>
        </div>
    );
}
export default GoalBox;
